let state = {
    dialogPage: {
        userData: [
            {"id": 1, "name": "Dmitri"},
            {"id": 2, "name": "Svetlana"},
            {"id": 3, "name": "Nauryz"},
            {"id": 4, "name": "Dinmukhamed"},
            {"id": 5, "name": "Mukhit"}
        ],
        messageData: [
            {"id": 1, "message": "Yo"},
            {"id": 2, "message": "Hello"},
            {"id": 3, "message": "How are you"}
        ]
    },
    profilePage: {
        postsData: [
            {"id": 1, "message": "Hello, how are you?", "likesCount": 5},
            {"id": 2, "message": "My, first post!", "likesCount": 2},
            {"id": 3, "message": "Hello, everyone", "likesCount": 10},
        ]
    },
    navbar: {
        navData:[
            {"id": 1, "href": "News", "photo": "https://image.flaticon.com/icons/svg/3158/3158703.svg"},
            {"id": 2, "href": "Profile", "photo": "https://image.flaticon.com/icons/svg/1077/1077114.svg"},
            {"id": 3, "href": "Message", "photo": "https://image.flaticon.com/icons/svg/2462/2462719.svg"},
            {"id": 4, "href": "Music", "photo": "https://image.flaticon.com/icons/svg/876/876817.svg"},
            {"id": 5, "href": "Settings", "photo": "https://image.flaticon.com/icons/svg/889/889744.svg"}
        ]
    }
}

export default state
